import styled from "styled-components";
import main from './Logos/main.png'
import cir from './Logos/cir.png'

const Toolbar = styled.header`
padding:20px;
background-color: #F56753;
font-family:Noto Serif;

color:#FFFFFF;
.grid{
    display:grid;
    grid-template-columns:10% 40% 15% 35%;
}
img{
    background-color:#F56753;
}
.img{
    margin-left:10%;
    /* padding:10px */
}
.card-text{
    //styleName: Body 1;
font-family: Noto Serif;
font-size: 1rem;
font-style: normal;
font-weight: 400;
line-height: 1.562rem;
letter-spacing: 0.01em;
text-align: left;

}
.card-ti{
    font-family: Poppins;
    font-style: normal;
    font-weight: 600;
    font-size: 1.5rem;
    color: #000000;
    margin-bottom: 0
px
;
    margin-top: 0
px
;
}
.form-control {
    width:16.93rem;
    height:2.5rem;
    border: 1px solid #FFFFFF;
box-sizing: border-box;
border-radius: 5px;
background-color:#F56753;
@media all and (max-width:1060px){
    width: 12rem;
}
}
.btn{
height:2.5rem ;
width: 7.31rem;
left: 28.81rem;
top: 36rem;
border-radius: 5px;
padding: 0.5rem 1rem 0.5rem 1rem;
background-color:#262626;
margin-left:1rem;
color:white;
@media all and (max-width:1060px){
    width: 5.5rem;
    margin-left:0px
}
.grid1{
    display:grid;
    grid-template-columns:30% 70%;

}
}

`

function Footer() {
    return (
        <>
            <Toolbar>
                <div className="fluid-container" >
                    <div className="img">
                        <img src={cir} className="p-2" alt="..." />
                        <img src={main} className="p-2" alt="..." />
                    </div>

                    <div className="grid ">
                        <div>

                        </div>
                        <div>
                            <div className="card mb-3">
                                <div class="card-body">
                                    <p class="card-text">We provide campervan rental in destinations across India through a seamless and personalized online experience.</p>
                                    <p class="card-ti mt-2 mb-0">Subscribe to our newsletter</p>

                                    <p class="card-text">Subscribe to receive occasional updates on top Campervan rental deals, special offers and insightful updates!</p>
                                </div>
                                <form class="d-flex">
                                    <input class="form-control me-2" type="search" placeholder="Enter  your e-mail" aria-label="Search" />
                                    <button class="btn btn-outline-success" type="submit">Subscribe</button>
                                </form>
                            </div>
                        </div>
                        <div>

                        </div>
                        <div>
                            <div className="card">
                                <div className="card-body">
                                    <p class="card-ti">Navigation</p>
                                    <div className="grid1">
                                        <div>
                                            <p>Home</p>
                                            <p>About us</p>
                                            <p>Services</p>
                                            <p>Contact us</p>
                                        </div>
                                        <div>
                                            <p>Privacy Policy</p>
                                            <p>Term & Conditions</p>
                                            <p>Refund & Cancellation policy</p>
                                            <p>FAQs</p>
                                        </div>
                                    </div>
                                    <p className="card-text">This is a wider card with supporting text below as a natural lead-in to additional content. This content is a little bit longer.</p>
                                    <p className="card-text"><small className="text-muted">Last updated 3 mins ago</small></p>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </Toolbar>

        </>
    )
}

export default Footer
